Perfection(ism)

Excerpt from recent post on http://lucimablog.blogspot.com (link above):

“All jokes aside, perfection has held me back as much as it has driven me to excellence/madness. I have gone to insane lengths in the name of perfection, but I think it's time to retire that mentality. My favorite pictures now are the ones that are "accidents". Pictures that are impossible to recreate because they are literally lightning in a bottle, frames between poses, forgetting to wind the film and double-exposing on the same frame, moving while shooting (or shooting through objects) and therefore creating motion blur or obstructive bokeh. It's the same as my shift in mentality toward shooting. I used to shoot to make pictures. Now I shoot to make friends. I mean it's even more poignant now that there's AI text-to-image generators and I can literally make pictures without people, so it's paramount that I stay in the moment to be part of the human experience rather than strictly focus on making compelling images. Sometimes it means slowing down. Sometimes it means stepping outside of my obsessive-compulsive mindset. Sometimes it means actually listening to what the model is saying (God forbid, lol). Whatever it is, it means that I'm not focusing on perfection but rather on the experience of taking pictures with another human being. These days, that is worth more than the value of the perfect image to me.”

